INSERT INTO `journal_encounter_section_locale` (`ID`, `locale`, `Title_lang`, `BodyText_lang`, `VerifiedBuild`) VALUES
(30861, 'deDE', 'Schadensklassen', '$bullet;Feuerteufel sollten vom Schlachtzug weggelockt werden. Die Explosion von |cFF2959D3|Hspell:464983|h[Fackel]|h|r ist groß und verursacht hohen Schaden.\n$bullet;Bis sie besiegt werden, setzen Flammenwandler |cFF2959D3|Hspell:470164|h[Magmainfusion]|h|r ein, wodurch es schwieriger wird, sich in der Eisenhalle zu bewegen.\n$bullet;Spielercharaktere sollten die Portalanker so schnell wie möglich zerstören und gleichzeitig sicherstellen, dass brennende Geister den |cFF2959D3|Hspell:464769|h[Zorn der Feuerlande]|h|r nicht erfolgreich einsetzen können.', 57534),
(30900, 'deDE', 'Zusammenfassung', 'Imperator Dagran Thaurissan und Prinzessin Moira Bronzebart sind beide formidable Kämpfer. Bei Moiras |cFF2959D3|Hspell:466504|h[Schattenwort: Nemesis]|h|r und |cFF2959D3|Hspell:470599|h[Schattenwort: Nekrose]|h|r ist Vorsicht geboten, sonst überwältigen sie den Schlachtzug. Moira wird versuchen, Dagran mit |cFF2959D3|Hspell:470605|h[Strahlender Infusion]|h|r zu heilen.\n\nDagran ist ein gefährlicher Nahkämpfer, der sich durch |cFF2959D3|Hspell:465077|h[Rufen der kaiserlichen Wache]|h|r und |cFF2959D3|Hspell:465079|h[Rufen der Botschafter des Schattenhammers]|h|r der Eindringlinge entledigen will. Wenn Moira besiegt wird, verwandelt sich Dagran in einen mächtigen |cFF2959D3|Hspell:465069|h[Avatar der Flamme]|h|r, wodurch all seine Fähigkeiten verstärkt werden.\n\nWenn er verzweifelt wird, richtet Dagran eine |cFF2959D3|Hspell:466332|h[Bitte an den Feuerlord]|h|r, ihn zu retten. Der Avatar von Ragnaros entfesselt eine Verwüstung, die langsam den gesamten Raum in geschmolzenes Feuer hüllt, bis Dagran besiegt wird. Dagran wird keine kaiserlichen Wachen oder Botschafter der Schattenhammer mehr rufen, sobald Ragnaros sich dem Kampf anschließt.', 57534),
(31073, 'deDE', '', '', 57534),
(30986, 'deDE', 'Abschnitt 24', '', 57534),
