(30887, 'deDE', 'Brennender Geist', '', 57534),
(30722, 'deDE', 'Zusammenfassung', 'Lord Roccor setzt |cFF2959D3|Hspell:462351|h[Brodelndes Magma]|h|r gegen sein Ziel ein, fügt ihm Schaden zu und liefert das Rohmaterial zum |cFF2959D3|Hspell:463674|h[Kristallisieren]|h|r seiner Obsidiannachkommenschaft.\n\nWenn Lord Roccor noch 95% seiner Gesundheit verbleiben und dann nach jeweils 20% erlittenem Schaden, setzt er |cFF2959D3|Hspell:462322|h[Eruption]|h|r ein und füllt den Raum mit |cFF2959D3|Hspell:462351|h[Brodelndem Magma]|h|r. Jedes |cFF2959D3|Hspell:462346|h[Lebendige Magma]|h|r, das sein Ziel erreicht, erhöht die Macht des durch |cFF2959D3|Hspell:462320|h[Feurige Kristallisierung]|h|r erzeugten Elementars.\n\nSobald Roccor 100 Energie erreicht, setzt er |cFF2959D3|Hspell:462317|h[Vulkanische Verwerfung]|h|r ein und fügt allen Spielercharakteren großen Schaden zu.', 57534),
(5499, 'deDE', 'Geringer Schattenspalt', 'Großhexenmeister Nethekurse erzeugt einen Riss der Auszehrung unter einem Spielercharakter. Dieser erleidet alle $30498t1 Sek. $30498s1 Schattenschaden, solange er sich im Riss befindet.', 57534),
(30988, 'deDE', 'Abschnitt 27', '', 57534),
(30760, 'deDE', 'Abschnitt 5', '', 57534),
(4910, 'deDE', 'Salve', 'Illyanna Rabeneiche feuert eine Pfeilsalve auf alle Spielercharaktere in einem $30933A1 Meter breiten Bereich ab, die $30933d lang alle $448891t1 Sek. $448891s1 Arkanschaden verursacht.', 57534);
