(147, 'deDE', 'Xal\'ataths List', 'Xal\'atath hintergeht Spielercharaktere, wobei sie ihre Handelsabmachungen widerruft und die Gesundheit und den Schaden von Gegnern um 10% erhöht.', 57534),
(152, 'deDE', 'Tücke des Herausforderers', 'Die Zeit wird um 90 Sekunden erhöht, doch beim Tod werden 15 Sekunden von der verbleibenden Zeit abgezogen.', 57534);
