(2265, 'deDE', 'Goldgeschmückter Händlerbrutosaurus', '|cFFFFD200WoW-Shop|r', 'Morten und Killia war nie bewusst, wie lukrativ ihre neue fraktionsübergreifende Handelspartnerschaft sein würde. Zumindest bis zu dem Tag, an dem sie sich endlich dieses schöne Geschöpf kaufen konnten, um ihnen ihre Reisen zu erleichtern. Und selbstverständlich in strahlend goldenem Stil.', 57534),
(2203, 'deDE', 'Kriegswolf der Kaldorei', '|cFFFFD200Promotion|r', 'Der Wolf wurde bei einem Schlachtzug der Kaldorei gefangen. Seine Loyalität gehört dem Stärksten.', 57534),
