INSERT INTO `scenario_step_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `VerifiedBuild`) VALUES
(6762, 'deDE', 'Entdeckt und analysiert die versteckten Runen im Bereich der Ausgrabungsstätte!', 'Analysiert die versteckten Runen', 57534),
(6802, 'deDE', 'Entfernt den Staub von den Knochen, damit sie untersucht werden können.', 'Putzt die Knochen!', 57534),
(6552, 'deDE', 'Werft den eifrigen Elementaren Hüte zu, um sie als Assistenzarchivare zu rekrutieren!', 'Rekrutiert eifrige Elementare', 57534),
(6765, 'deDE', 'Entdeckt und analysiert die Relikte im Bereich der Ausgrabungsstätte!', 'Analysiert uralte Relikte', 57534),
(6549, 'deDE', '', 'Bereitet Euch auf den Kampf vor!', 57534),
(6200, 'deDE', 'Repariert Schaufeln und stellt sie für die anderen Archivare bereit!', 'Repariert Schaufeln', 57534),
(6584, 'deDE', 'Besiegt die erweckten Agenten von Neltharion, die die Ausgrabungsstätte angreifen!', 'Eliminiert erweckte Agenten', 57534),
(6578, 'deDE', 'Entdeckt und analysiert die versteckten Runen im Bereich der Ausgrabungsstätte!', 'Analysiert die versteckten Runen', 57534),
(6760, 'deDE', 'Bringt eine Artefaktkiste zu Untersuchungszwecken zu Zenata!', 'Lieferung für Zenata', 57534),
(6803, 'deDE', 'Bücherwürmer bedrohen unsere Forschung! Zerstampft sie, um sie aufzuhalten.', 'Zerstampft Bücherwürmer!', 57534),
(6204, 'deDE', 'Der Geist der Ruhestätte des Verräters greift an! Wir müssen die Ausgrabungsstätte beschützen, um weitergraben zu können!', 'Das Ende der Ruhestätte des Verräters!', 57534),
(6202, 'deDE', 'Nirobins Folianten wurden verstreut! Schickt die richtigen zum Bücherregal und die falschen ins Büro.', 'Bringt verstreute Folianten zurück', 57534),
(6191, 'deDE', 'Stellt Euch neben Eadweard und wartet auf seine Anweisungen.', 'Die Suche nach Wissen beginnt!', 57534),
(6407, 'deDE', 'Kanalisiert auf Nirobins Otterfamiliare, um deren Hinweise findende Gegenstücke zu entfesseln!', 'Lasst die Otter los!', 57534),
(6539, 'deDE', 'Uralte Djaradin haben sich erhoben und greifen an! Beschützt unsere Ausgrabungsstätte vor ihren Übergriffen!', 'Wehrt Djaradinphantome ab', 57534),
(6406, 'deDE', 'Liefert Azersuppe an die hungrigen Archivare aus.', 'Füttert die Archivare', 57534),
(6197, 'deDE', 'Grabt die gigantischen Drachenknochen aus!', 'Grabt Drachenknochen aus', 57534),
(6201, 'deDE', 'Brecht die Felsbrocken in Stücke und werft die Fragmente weg!', 'Zerbrecht und beseitigt Felsbrocken', 57534),
(6195, 'deDE', 'Markiert und analysiert die Relikte um das Skelett herum!', 'Analysiert uralte Relikte', 57534),
(6196, 'deDE', 'Untersucht die aufgewühlte Erde und grabt nach Artefakten!', 'Inspiziert das Lager', 57534),
(6193, 'deDE', 'Entfernt an der Ausgrabungsstätte Büsche und Gräser.', 'Beseitigt Rastgras', 57534),
(6764, 'deDE', 'Entdeckt und analysiert die Relikte im Bereich der Ausgrabungsstätte!', 'Analysiert uralte Relikte', 57534),
(6805, 'deDE', 'Sprecht mit Zenata, um einige Runen zu erhalten, die Ihr zum Hauptlager bringen könnt.', 'Runen von Zenata!', 57534),
(6553, 'deDE', 'Stellt Ausrüstung an einem wichtigen, abgelegenen Ort auf!', 'Richtet eine Satellitengrabungsstätte ein', 57534),
(6551, 'deDE', 'Bringt den sonnenverbrannten Archivaren im Feld ein paar Hüte, damit sie abkühlen können!', 'Schutz für sonnenverbrannte Archivare', 57534),
(6806, 'deDE', 'Sprecht mit Nirobin, um einige Bücher zu erhalten, die Ihr zum Hauptlager bringen könnt.', 'Bücher von Nirobin!', 57534),
(6627, 'deDE', 'Es läuft für uns! Bleibt in der Nähe von Eadweard und wartet auf Anweisungen. Bereit zum Graben?', 'Einer Entdeckung auf der Spur!', 57534),
(6199, 'deDE', 'Sortiert historisch bedeutende Steine und gewöhnliche Steine!', 'Sortiert bedeutsame Steine', 57534),
(6763, 'deDE', 'Entdeckt und analysiert die versteckten Runen im Bereich der Ausgrabungsstätte!', 'Analysiert die versteckten Runen', 57534),
(6542, 'deDE', 'Nutzt Hap\'he, um an der Ausgrabungsstätte Hinweise zu finden!', 'Sammelt Forschungshinweise', 57534),
(6544, 'deDE', 'Besiegt mit Eurem Otterfamiliar informationsreiche Hinweise und sammelt sie ein!', 'Sammelt informationsreiche Hinweise', 57534),
